import Nav from "./components/welcoming/welcomingNav/nav";
import Header from "./components/welcoming/welcomingHeader/header"
import Services from "./components/welcoming/welcomingServices/services";
import Achievments from "./components/welcoming/welcomingAchievments/achievments"
import About from "./components/welcoming/welcomingAbout/about"
import signIn from "./components/signIn-signUp/signIn";
const App = () => {
  return (
   <>
   <signIn />
   <Nav />
   <Header />
   <Services />
   <Achievments />
   <About />
   </>
  );
}

export default App;
